Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (101,'가을 맞이 특별 프로모션 안내','{"blocks":[{"key":"93ajh","text":"안녕하세요, 오피스24입니다.\n\n가을을 맞이하여 오피스24에서 특별 프로모션을 진행합니다. 서울 및 경기 지역의 신규 매물에 대해 최대 15% 할인을 제공하며, 이번 프로모션 기간 동안 임대 계약을 체결한 고객님들께는 추가 혜택도 준비되어 있습니다.\n\n프로모션 기간: 2024년 9월 1일 ~ 10월 15일\n\n더 자세한 정보는 홈페이지를 참고해주시기 바라며, 많은 관심 부탁드립니다.\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('09/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (104,'오피스24 서비스 개편 안내','{"blocks":[{"key":"6ucag","text":"안녕하세요, 오피스24입니다.\n\n고객님들의 편리한 사용을 위해 오피스24의 서비스가 새롭게 개편되었습니다. 개편된 서비스는 사용자 경험을 극대화하기 위해 UI/UX 디자인을 개선하고, 빌딩 검색 속도를 대폭 향상시켰습니다. 또한, 새로운 검색 필터 기능이 추가되어 원하는 매물을 더욱 빠르고 정확하게 찾을 수 있습니다.\n\n새로운 기능을 직접 경험해 보세요!\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (103,'시스템 유지보수 안내','{"blocks":[{"key":"fad3m","text":"안녕하세요, 오피스24입니다.\n\n더 나은 서비스 제공을 위해 2024년 8월 20일(화) 오전 2시부터 4시까지 시스템 유지보수가 예정되어 있습니다. 이 시간 동안 서비스 이용이 일시 중단될 수 있으니 양해 부탁드립니다.\n\n유지보수 완료 후 더욱 안정적이고 편리한 서비스를 제공해드리겠습니다. 감사합니다.\n\n오피스24 드림😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (105,'신규 매물 등록 안내','{"blocks":[{"key":"9g3gf","text":"안녕하세요, 오피스24입니다.\n\n서울 강남구, 마포구, 성수동 지역에 신규 매물이 대거 등록되었습니다. 해당 매물은 다양한 면적과 조건을 갖추고 있으며, 사무실 임차를 고려 중인 고객님들께 최적의 선택이 될 것입니다.\n\n자세한 정보는 홈페이지의 신규 매물 섹션에서 확인하시거나 고객센터로 문의해 주세요.\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (106,'긴급 서버 점검 안내','{"blocks":[{"key":"9nu16","text":"안녕하세요, 오피스24입니다.\n\n갑작스러운 시스템 오류로 인해 2024년 8월 25일(일) 오전 1시부터 3시까지 긴급 서버 점검이 진행될 예정입니다. 이 기간 동안 서비스 이용이 일시 중단될 수 있으며, 고객님들께서는 양해 부탁드립니다.\n\n서버 점검 후 더욱 안정적인 서비스로 돌아오겠습니다. 불편을 드려 죄송합니다.\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (107,'새로운 파트너사 제휴 안내','{"blocks":[{"key":"bggs","text":"안녕하세요, 오피스24입니다.\n\n오피스24는 고객님들께 더 나은 서비스를 제공하기 위해 새로운 파트너사와 제휴를 맺었습니다. 이제 더욱 다양한 오피스 매물 정보를 제공하며, 파트너사의 특별 혜택도 누릴 수 있게 되었습니다.\n\n자세한 제휴 혜택은 홈페이지에서 확인 가능하며, 관련 문의는 고객센터로 연락 부탁드립니다.\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (108,'서비스 이용 약관 변경 안내','{"blocks":[{"key":"f19pl","text":"안녕하세요, 오피스24입니다.\n\n2024년 9월 1일부터 오피스24의 서비스 이용 약관이 일부 변경됩니다. 변경된 약관은 사용자 권리 보호 및 서비스 개선을 위한 내용이 포함되어 있으며, 상세 내용은 홈페이지에서 확인하실 수 있습니다.\n\n변경된 약관에 대한 궁금한 사항은 고객센터를 통해 문의해 주시기 바랍니다.\n\n항상 오피스24를 이용해 주셔서 감사합니다.\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
Insert into "OFFICE24"."NOTICE" (NO,TITLE,CONTENT,REG_DATE) values (109,'고객 만족도 설문 조사 이벤트 안내','{"blocks":[{"key":"59ugn","text":"안녕하세요, 오피스24입니다.\n\n오피스24의 서비스 향상을 위해 고객님들의 소중한 의견을 듣고자 고객 만족도 설문 조사를 진행합니다. 설문에 참여해 주신 모든 분들께는 추첨을 통해 다양한 경품을 드립니다.\n\n설문 기간: 2024년 9월 1일 ~ 9월 10일\n참여 방법: 오피스24 홈페이지에서 설문 조사 참여\n\n많은 참여 부탁드리며, 앞으로도 더욱 만족스러운 서비스를 제공할 수 있도록 최선을 다하겠습니다.\n\n오피스24 드림 😀","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}',to_timestamp('14/08/24','DD/MM/RR HH24:MI:SSXFF'));
